🎧 A 30 AÑOS DE "EL AMOR DESPUÉS DEL AMOR"

@LautaroMaislin estuvo presente en la primera función que Fito Páez dio en el Movistar Arena, en el marco de los 30 años de su álbum musical "El Amor Después Del Amor". 

🎙 Allí habló con fanáticos y pudo presenciar un show inolvidable que contó con la presencia de figuras como Cecilia Roth y Fabiana Cantilo.
